content:
Black Lives Matter means Haitian Lives Matter–period.

There must be accountability for the inhumane treatment of Haitian migrants by @CBP agents.

@POTUS must lead with compassion &amp; #StopTheFlights. https://t.co/3j71xfmnMl

The Supreme Court made a deadly decision to strike down the eviction moratorium. Thousands are dying from COVID-19 every day.

@SenWarren and I are introducing a bill to stop evictions and save lives.

Pass the Keeping Renters Safe Act. https://t.co/tSlBCcrt52

Let’s be clear - the United States defaulting on our debt would be a disaster.

And those aren’t my words. They’re @LeaderMcConnell’s. 

@GOP -- don’t mess with the full faith and credit of the United States of America.
